const HomeColors = ()=>{
    return (
        <div className="App">
          <h1>Color Picker</h1>
          <ul>
            <li>pink</li>
            <li>red</li>
            <li>blue</li>
          </ul>
        </div>
      );
}
export default HomeColors;
